import React, { useState } from 'react';


const Edoprod= () => {
  const [selectedFiles, setSelectedFiles] = useState([]);

  const files = {
    'ACFC Response': [
      { name: 'Excel File 1', type: 'excel', path: 'https://hexawareonline.sharepoint.com/teams/ACFCAmeriHealthInduction/Shared%20Documents/Forms/AllItems.aspx?id=%2Fteams%2FACFCAmeriHealthInduction%2FShared%20Documents%2FGeneral%2F04%20Projects%20and%20Tracks%20in%20ACFC%2FEDO%20%2DPROD%20Support%2FACFC%20Response%20Excel&viewid=23e661ba%2D2575%2D40da%2Dacae%2Da72704d26148' },
      { name: 'Excel File 2', type: 'excel', path: '/acfc_response/excel_file2.xlsx' },
      // Add more files as needed
    ],
    'Ticket Data': [
      { name: 'Excel File 3', type: 'excel', path: 'https://hexawareonline.sharepoint.com/teams/ACFCAmeriHealthInduction/Shared%20Documents/Forms/AllItems.aspx?id=%2Fteams%2FACFCAmeriHealthInduction%2FShared%20Documents%2FGeneral%2F04%20Projects%20and%20Tracks%20in%20ACFC%2FEDO%20%2DPROD%20Support%2FACFC%20Response%20Excel&viewid=23e661ba%2D2575%2D40da%2Dacae%2Da72704d26148' },
      { name: 'Excel File 4', type: 'excel', path: '/ticket_data/excel_file4.xlsx' },
      // Add more files as needed
    ],
  };

  const handleFileDisplay = (folder) => {
    // Display all Excel files in the selected folder
    const folderFiles = files[folder];
    setSelectedFiles(folderFiles.map(file => file.path));
    window.location.href = folderFiles.map(file => file.path); // Set the location to the first file path
  };
  
  return (
    <div className="container2">
      <div className="buttons-container">
      <button className="button2" onClick={() => handleFileDisplay('ACFC Response')}>
        ACFC Response Excel
      </button>
      <button className="button2" onClick={() => handleFileDisplay('Ticket Data')}>
        Enhancements and Ticket Data
      </button>
      {selectedFiles.length > 0 && (
        <div className="file-container">
          {/* Display all Excel files in the selected folder */}
          {selectedFiles.map((path, index) => (
            <iframe key={index} className="file-display" src={path} title={`Excel File ${index}`} />
          ))}
        </div>
      )}
      </div>
    </div>
  );
};

export default Edoprod;
